import React from "react";

// Define the JSX structure as an object
const layout3Object = {
  type: "Box",
  props: {
    bg: "gray.4",
    h: 200,
    style: { borderRadius: "10px" },
  },
  children: [
    {
      type: "Stack",
      children: [
        {
          type: "Box",
          props: {
            bg: "lime.5",
            style: { borderRadius: "10px 10px 0 0", cursor: "pointer" },
          },
          children: {
            type: "Center",
            children: {
              type: "Text",
              children: "Test",
            },
          },
        },
        {
          type: "Grid",
          props: { ml: "xs", mr: "xs" },
          children: ["Item 1", "Item 2", "Item 3"].map((item) => ({
            type: "Grid.Col",
            props: { span: 4 },
            children: {
              type: "Box",
              props: {
                bg: "blue.1",
                h: 60,
                style: { border: "1px solid #000000", cursor: "pointer" },
              },
              children: {
                type: "Center",
                children: item,
              },
            },
          })),
        },
      ],
    },
  ],
};

// A rendering function that takes the object and generates JSX
const renderObject = (obj) => {
  const { type, props, children } = obj;
  if (Array.isArray(children)) {
    return React.createElement(type, props, ...children.map(renderObject));
  }
  return React.createElement(type, props, children);
};

const Layout3 = () => {
  // Call the rendering function with the object to render the JSX
  return renderObject(layout3Object);
};

export default Layout3;
